script: |
  super -f text -I q1520.spq | sort > q1520.out

inputs:
  - name: q1520.spq
    data: |
      SELECT DISTINCT - ( - 90 ) AS col1 FROM tab2 (FORMAT parquet) WHERE + + col0 * + + col2 * 7 + + + 79 + col0 NOT IN ( + + 96, col1 );
  - name: tab2

outputs:
  - name: q1520.out
    data: |
      90
